import './App.css';
import Column from './Components/Column.js';
import MenuHeader from './Components/Menu-Header.js';

export default function App() {
  return (
    <div>
      <div className="mt-20vh mx-auto w-3/4 flex justify-between items-center">
        <div className="w-1/3 h-px bg-gray-500"></div>
        <span className="text-red-700">STARKVILLE, MS</span>
        <div className="w-1/3 h-px bg-gray-500"></div>
      </div>
      {/* Restaurant name and image */}
      <div className="mt-8vh mx-auto w-3/4 flex items-center">
        {/* Column for restaurant name */}
        <div className="w-3/4"> {/* Adjusted width */}
          <h1 className="text-3xl font-bold text-red-700">The Little Dooey</h1>
        </div>
        {/* Vertical separator */}
        <div className="w-1/4 flex items-center justify-center"> {/* Adjusted width */}
          <div className="h-10 w-px bg-gray-500"></div>
        </div>
        {/* Image */}
        {/* <div className="w-1/5">
          <img src="path_to_your_image.jpg" alt="Restaurant Image" className="h-full w-full object-cover" />
        </div> */}
      </div>

      {/* Horizontal line */}
      <div className="mt-10px mx-auto w-3/4 flex justify-between items-center">
        <div className="w-full h-px bg-gray-500"></div>
      </div>

      {/* Menu headers */}
      <div className="mt-8vh mx-auto w-3/4 flex justify-between">
        {/* Column for each menu category */}
        <Column>
          <MenuHeader title="SALADS" />
        </Column>
        <Column>
          <MenuHeader title="STARTERS" />
        </Column>
        <Column>
          <MenuHeader title="WRAPS" />
        </Column>
      </div>
    </div>
  )
}
